snippet.textDisplay:
তাজিকিস্তানের Noziya Karomatullo নামের এক সিঙ্গার আমাদের দেশের আমরিন মূসা আর  ফুয়াদ আল মুক্তাদিরের "ভ্রমর কইয়ো গিয়া" গানের সুর, কম্পোজিশন একই রেখে তাজিক ভাষায় (Kujo Kujo টাইটেল) কভার করছিলো। Noziya অনেক হিন্দি গানও কভার করছে। 

@CokeStudioBangla 
একটা কাজ করতে পারে, আমরিন মূসা আর Noziya Karomatullo কে CSB এর স্টেজে একসাথে এনে "ভ্রমর কইয়ো গিয়া" আর "Kujo Kujo" এর compilation/mash up টাইপের কিছু একটা তৈরি করতে পারে।

